import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import * as serviceWorker from './serviceWorker';

/*
const Table = ({data}) = (
  <table>
    {data.map(row => {
      <TableRow row={row} />
    })}
  </table>
);
//*/

class EscalaFE extends React.Component{
	constructor(props){
		super(props);

		this.state = {
			escala: []
		};
	}

	componentDidMount() {
    	fetch('http://homestead.local/escala')
      		.then(response => response.json())
      		.then(escala => this.setState({ escala }))
      		.catch(e => {
    			console.log(e);
    			return e;
  			}); 		
  	}

  	renderTableRow(){
		return this.state.escala.map((item, i) => {
			return(
				<tr>
				    <td>{item.user}</td>
				    <td i={item.email}>{item.email}</td>
				    <td i={item.company}>{item.company}</td>
				    <td i={item.escalas}>{item.escalas}</td>
				    <td i={item.status}>{item.status}</td>
				</tr>
			)
		})
	}

  	render(){
  		return(
  			<div>
  			<h3>Usuários</h3>
  			<table>
	  			<thead>
		  			<tr>
		  				<td>Usuário</td>
		  				<td>Email</td>
		  				<td>Company</td>
		  				<td>Escalas</td>
		  				<td>Status</td>
		  			</tr>
	  			</thead>
	  			<tbody>{this.renderTableRow()}</tbody>
  			</table>
  			</div>
  		);
  	}

}

//ReactDOM.render(<App />, document.getElementById('root'));
ReactDOM.render(<EscalaFE />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
